import "./App.css";
import React from "react";
import Todo from "./Todo";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      item: [
        { id: 0, title: "책 다 읽기", done: true },
        { id: 0, title: "강의 다 보기", done: false },
      ],
    };
  }
  render() {
    return (
      <div className='App'>
        <Todo item={this.state.item} />
      </div>
    );
  }
}
export default App;
